// Generate base64 icons and write as files
const fs = require('fs');

// Simple base64 encoded icon (192x192 blue with white "F")
const icon192Base64 = '';

const fs = require('fs');

// Create all required icon sizes by decoding and resizing the base64
const sizes = [72, 96, 128, 144, 152, 192, 384, 512];

// Simple SVG template for different sizes
function generateSVG(size) {
    return `<?xml version="1.0" encoding="UTF-8"?>
<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 ${size} ${size}">
  <defs>
    <linearGradient id="grad1" x1="0%" y1="0%" x2="100%" y2="100%">
      <stop offset="0%" style="stop-color:#2563eb;stop-opacity:1" />
      <stop offset="100%" style="stop-color:#1d4ed8;stop-opacity:1" />
    </linearGradient>
  </defs>
  <rect width="${size}" height="${size}" fill="url(#grad1)" rx="${size * 0.125}" ry="${size * 0.125}"/>
  <g fill="white" transform="translate(${size * 0.25}, ${size * 0.2})">
    <rect x="0" y="0" width="${size * 0.5}" height="${size * 0.65}" rx="${size * 0.03}" stroke="white" stroke-width="${size * 0.015}" fill="none"/>
    <rect x="${size * 0.05}" y="${size * 0.08}" width="${size * 0.4}" height="${size * 0.12}" rx="${size * 0.015}" fill="white" opacity="0.9"/>
    <rect x="${size * 0.05}" y="${size * 0.25}" width="${size * 0.4}" height="${size * 0.12}" rx="${size * 0.015}" fill="white" opacity="0.7"/>
    <rect x="${size * 0.05}" y="${size * 0.42}" width="${size * 0.4}" height="${size * 0.12}" rx="${size * 0.015}" fill="white" opacity="0.5"/>
    <circle cx="${size * 0.4}" cy="${size * 0.14}" r="${size * 0.02}" fill="white"/>
    <circle cx="${size * 0.4}" cy="${size * 0.31}" r="${size * 0.02}" fill="white"/>
    <circle cx="${size * 0.4}" cy="${size * 0.48}" r="${size * 0.02}" fill="white"/>
  </g>
  <text x="${size/2}" y="${size * 0.85}" text-anchor="middle" fill="white" font-family="Arial, sans-serif" font-size="${size * 0.08}" font-weight="bold">SPF</text>
</svg>`;
}

// Write SVG files for each size
sizes.forEach(size => {
    const svg = generateSVG(size);
    fs.writeFileSync(`icon-${size}x${size}.svg`, svg);
    console.log(`Generated icon-${size}x${size}.svg`);
});

// Generate favicon SVG
const faviconSVG = generateSVG(32);
fs.writeFileSync('favicon.svg', faviconSVG);
console.log('Generated favicon.svg');

console.log('\nTo convert SVG to PNG, open each SVG in a browser and use browser tools to export as PNG.');
console.log('Or use online converters like: https://convertio.co/svg-png/');